import React from 'react';
import styles from './home.module.css';

const Home = (props) => {

    return(
        <div className={styles.bg} style={{
            width:480,
            height:480, 
            background: `url('${process.env.PUBLIC_URL}/twitter.png')`
          }}>
            <h1>This is red car</h1>
        </div>
    
    )
};

export default Home;
